import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './components/app/';

function WhoAmI(props) {
    return (
        <React.Fragment>
            <h1>My name is {props.name=alm}, surname - {props.surname} </h1>
            <a href="{props.link}">My Profile</a>
        </React.Fragment>
    )
}

ReactDOM.render(<WhoAmI name="Almaz" surname="Sharipov" link="vk.com"/>,  document.getElementById('root'));
